import React from 'react';

const Hero = () => {
  return (
    <section className="hero">
      <h2 style={{left:0,top:0,position: 'absolute',color: 'white', fontSize: 96, fontFamily: 'Poppins', fontWeight: '700', wordWrap: 'break-word'}}>Add Your Project</h2>
      <div style={{left:0,top:170,position: 'absolute',color: '#DBFF00', fontSize: 96, fontFamily: 'Poppins', fontWeight: '500', wordWrap: 'break-word'}}>HERE</div>
      <img style={{width: '100%', height: '100%', transform: 'rotate(180deg)', transformOrigin: '0 0'}} src="https://via.placeholder.com/634x402" /> 
    </section>
  );
};

export default Hero;
